import React from 'react';

const SocialMediaIcon = ({ icon, url }) => (
  <a href={url} target="_blank" rel="noopener noreferrer">
    <img src={icon} alt="Icono de red social" />
  </a>
);

const SocialMediaList = () => {
  const socialMediaData = [
    { icon: 'facebook.png', url: 'https://www.facebook.com' },
    { icon: 'twitter.png', url: 'https://www.twitter.com' },
    { icon: 'instagram.png', url: 'https://www.instagram.com' },
    // Agrega aquí más objetos de redes sociales si es necesario
  ];

  return (
    <div>
      <img src="icono.png" alt="Icono" />
      <ul>
        {socialMediaData.map((socialMedia, index) => (
          <li key={index}>
            <SocialMediaIcon icon={socialMedia.icon} url={socialMedia.url} />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SocialMediaList;
